function byId(id){return document.getElementById(id)}
if('serviceWorker' in navigator){window.addEventListener('load',()=>{navigator.serviceWorker.register('/service-worker.js')})}
window.addEventListener('load',()=>{var anchors=document.getElementsByTagName('a');if(!!anchors&&!!anchors.length){for(var i=0;i<anchors.length;i++){if(!anchors[i].classList.contains('local-link')){anchors[i].target='_blank';anchors[i].rel='noopener noreferrer'}}}
byId('menuButton').addEventListener('click',toggleMenu);var dditems=document.getElementsByClassName('dropdown-item');for(var i=0;i<dditems.length;i++){dditems[i].addEventListener('click',toggleMenu)}
if(byId('menuDiv').offsetHeight>0){byId('menuDiv').setAttribute('aria-hidden',!1)}});function toggleMenu(){var menu=byId('menu');if(menu.classList.contains('show')){menu.classList.remove('show');menu.setAttribute('aria-hidden',!0);byId('menuButton').setAttribute('aria-expanded',!1)}else{menu.classList.add('show');menu.setAttribute('aria-hidden',!1);byId('menuButton').setAttribute('aria-expanded',!0)}}
